import "./ExpenseItem.css";

// making the component(a simple js function returning a JSX

function ExpenseItem() {
  return (
    <div>
      <div> 1 July </div>
      <h2> Gas Booking </h2>
      <div> 1000 Rs </div>
    </div>
  );
}

export default ExpenseItem;
